import React from 'react';
import './App.css';
import { Grid, TextField, Button } from '@material-ui/core';
import { Delete, AddCircle } from '@material-ui/icons';
import { Form } from './components/Form/Form';

function App() {
  return (
    <div className="App">
      <Grid container spacing={3} justify="center">
        <Grid item xs={12}>
          <header>
            <h1 className="title">Rodri's Todo List</h1>
          </header>
        </Grid>
      </Grid>
      <form>
        <Grid container justify="center">
          <TextField label="Todo" name="todo" size="large" />

          <Button
            variant="contained"
            color="primary"
            startIcon={<AddCircle />}
          >
            Add
          </Button>

          <Button
            variant="contained"
            color="secondary"
            startIcon={<Delete />}
          >
            Delete
          </Button>
        </Grid>
      </form>
    </div>
  );
}

export default App;
